"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; background-color:#ffffff;\"><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:696; color:#333333; background-color:#ffffff;\">Comer vegetales es imprescindible para nuestra salud.</span></p>\n"
"<p style=\" margin-top:3px; margin-bottom:15px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; background-color:#ffffff;\"><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333; background-color:#ffffff;\">Este shot</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">elaborado con espinacas, pepino y espirulina</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> es ideal para darte los </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">aportes de vitaminas y de minerales</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> (sobre todo hierro) para que no te falte de nada.<br /><br /></span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">La espinaca</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">, base de este shot, es muy </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">rica en hierro y magnesio</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">, y ayuda a regular la presión arterial. Además, contiene pepino que es un gran diurético, </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">rico en vitamina C, potasio y magnesio</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">.<br /></span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\"><br />La espirulina</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> es un </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">superalimento</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> que tiene un alto contenido en proteínas, además de ser un </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">excelente revitalizante</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">. Además, añadimos </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">jengibre</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">, con </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">grandes propiedades antiinflamatorias</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\">, </span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:600; color:#333333;\">guaraná para darte energía</span><span style=\" font-family:\'Montserrat,sans-serif\'; font-weight:496; color:#333333;\"> y manzana para equilibrar el sabor</span></p>\n"
